  const [patientId, setPatientId] = useState("");
  const [type, setType] = useState("");



  return (
    <>
      <SearchBar onSearch={setPatientId} a={setType}></SearchBar>
      <p>{patientId}</p>
      <Dashboard patient={patientId} type={type}></Dashboard>
    </>
  );
}

export default App;

